К участию в процедуре продажи допускаются любые юридические и физические лица, за исключением: 
государственных и муниципальных унитарных предприятий, государственных и муниципальных учреждений; 
юридических лиц, в уставном капитале которых доля Российской Федерации, субъектов Российской Федерации и муниципальных образований превышает 25 %; 
юридических лиц, местом регистрации которых является государство или территория, включённые в утверждаемый Министерством финансов Российской Федерации переч
